    return res(
      ctx.json({
        id: 'f79e82e8-c34a-4dc7-a49e-9fadc0979fda',
        firstName: 'John',
        lastName: 'Marverick',
      })
    )
  }),
  rest.get('https://raw.githubusercontent.com/techoi/raw-data-api/main/simple-api.json?id=react', async(req, res, ctx) => {
    const id = req.url.searchParams.get('id')
